<html>
<head>
    <script>
        (function () {
            var i = sessionStorage.length;
            while (i--) {
                var key = sessionStorage.key(i);
                if (/^_goLabCache/.test(key)) {
                    sessionStorage.removeItem(key);
                }
            }
            sessionStorage.removeItem("_ilsStructure_");
        })();
    </script>
</head>
<body></body>
</html>
